BEGIN TRANSACTION;
CREATE TABLE ammobox (
	id INTEGER NOT NULL, 
	name VARCHAR, 
	attachcount INTEGER, 
	prop INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE attachments (
	id INTEGER NOT NULL, 
	name VARCHAR, 
	attachcount INTEGER, 
	prop INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE bullets (
	id INTEGER NOT NULL, 
	name VARCHAR, 
	attachcount INTEGER, 
	prop INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE items (
	id INTEGER NOT NULL, 
	name VARCHAR, 
	nominal INTEGER, 
	min INTEGER, 
	qmin INTEGER, 
	qmax INTEGER, 
	restock INTEGER, 
	lifetime INTEGER, 
	usage VARCHAR, 
	tier VARCHAR, 
	rarity VARCHAR, 
	cat_type VARCHAR, 
	item_type VARCHAR, 
	sub_type VARCHAR, 
	mod VARCHAR, 
	trader VARCHAR, 
	dynamic_event INTEGER, 
	count_in_cargo INTEGER, 
	count_in_hoarder INTEGER, 
	count_in_map INTEGER, 
	count_in_player INTEGER, 
	buyprice INTEGER, 
	sellprice INTEGER, 
	"traderExclude" INTEGER, 
	"traderCat" VARCHAR, 
	min_stock INTEGER, 
	max_stock INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE link_attachments (
	id INTEGER NOT NULL, 
	itemname VARCHAR, 
	attachname VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE link_bullet_to_mags (
	id INTEGER NOT NULL, 
	magname VARCHAR, 
	bulletname VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE link_bullets (
	id INTEGER NOT NULL, 
	itemname VARCHAR, 
	bulletname VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE link_mags (
	id INTEGER NOT NULL, 
	itemname VARCHAR, 
	magname VARCHAR, 
	PRIMARY KEY (id)
);
CREATE TABLE magazines (
	id INTEGER NOT NULL, 
	name VARCHAR, 
	attachcount INTEGER, 
	prop INTEGER, 
	PRIMARY KEY (id)
);
CREATE TABLE mapselect (
	id INTEGER NOT NULL, 
	mapselectvalue VARCHAR, 
	PRIMARY KEY (id)
);
COMMIT;
